contracts/AvatarNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

contract AvatarNFT is ERC721, ERC721URIStorage, AccessControl, Pausable {
  using Counters for Counters.Counter;

  bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
  Counters.Counter private _tokenIdCounter;

  constructor() ERC721("AvatarNFT", "AVA") {
    _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    _grantRole(MINTER_ROLE, msg.sender);
  }

  function burn(uint256 _tokenId) public onlyRole(MINTER_ROLE) whenNotPaused {
    _burn(_tokenId);
  }

  function _burn(
    uint256 _tokenId
  )
    internal
    override(ERC721, ERC721URIStorage)
    onlyRole(MINTER_ROLE)
    whenNotPaused
  {
    super._burn(_tokenId);
  }

  function safeMint(
    address _to,
    string memory _uri
  ) public onlyRole(MINTER_ROLE) whenNotPaused {
    uint256 tokenId = _tokenIdCounter.current();
    _tokenIdCounter.increment();
    _safeMint(_to, tokenId);
    _setTokenURI(tokenId, _uri);
  }

  function tokenURI(
    uint256 _tokenId
  )
    public
    view
    override(ERC721, ERC721URIStorage)
    whenNotPaused
    returns (string memory)
  {
    return super.tokenURI(_tokenId);
  }

  function supportsInterface(
    bytes4 _interfaceId
  )
    public
    view
    override(ERC721, ERC721URIStorage, AccessControl)
    whenNotPaused
    returns (bool)
  {
    return super.supportsInterface(_interfaceId);
  }

  function setTokenURI(
    uint256 _tokenId,
    string memory _uri
  ) public onlyRole(DEFAULT_ADMIN_ROLE) whenNotPaused {
    require(
      _exists(_tokenId),
      "ERC721URIStorage: URI set of nonexistent token"
    );
    _setTokenURI(_tokenId, _uri);
  }

  function pause() public onlyRole(DEFAULT_ADMIN_ROLE) {
    _pause();
  }

  function unpause() public onlyRole(DEFAULT_ADMIN_ROLE) {
    _unpause();
  }
}

contracts/racing/AvatarSmashEvent.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "./../AvatarNFT.sol";

contract AvatarSmashEvent is Ownable, Pausable {
  AvatarNFT public nftToken;

  using Counters for Counters.Counter;
  Counters.Counter private _nextMatchId;

  struct Fight {
    uint256 fightId;
    uint256 entryFee;
    uint256 totalPrizePool;
    uint256 numWinners;
    uint256[] prizeDistribution;
    uint256 minParticipants;
    bool active;
    bool started;
    bool ended;
    uint256[] winningFighterIds;
    uint256[] participants;
  }

  mapping(uint256 => Fight) public fights;

  event FightCreated(
    uint256 fightId,
    uint256 entryFee,
    uint256 numWinners,
    uint256[] prizeDistribution
  );
  event FighterEnteredMatch(
    uint256 fightId,
    address avatarOwner,
    uint256 nftId
  );
  event MatchStarted(uint256 fightId);
  event MatchEnded(uint256 fightId, uint256[] winningIds);

  constructor(address _nftContractAddress) {
    nftToken = AvatarNFT(_nftContractAddress);
  }

  // function to create a fight
  function createFight(
    uint256 _entryFee,
    uint256[] memory _prizeDistribution
  ) public onlyOwner whenNotPaused {
    uint256 totalPercentage;
    uint numWinners = _prizeDistribution.length;
    for (uint256 i = 0; i < _prizeDistribution.length; i++) {
      totalPercentage += _prizeDistribution[i];
    }
    require(totalPercentage <= 100, "Total distribution exceeds 100%");
    require(totalPercentage >= 100, "Total distribution less than 100%");
    require(numWinners <= 5, "Max 5 winners allowed");

    uint256 fightId = _nextMatchId.current();

    fights[fightId] = Fight({
      fightId: fightId,
      entryFee: _entryFee,
      totalPrizePool: 0,
      numWinners: numWinners,
      prizeDistribution: _prizeDistribution,
      minParticipants: numWinners * 3,
      active: true,
      started: false,
      ended: false,
      winningFighterIds: new uint256[](0),
      participants: new uint256[](0)
    });

    emit FightCreated(fightId, _entryFee, numWinners, _prizeDistribution);

    _nextMatchId.increment();
  }

  // function to register a nft in a fight
  function enterFighterInFight(
    uint256 _fightId,
    uint256 _nftId
  ) public payable whenNotPaused {
    Fight storage fight = fights[_fightId];
    require(getMatchStatus(_fightId), "Fight not active or already started");
    require(getOwnerOfAvatar(_nftId) == msg.sender, "Not owner");
    require(msg.value == fight.entryFee, "Incorrect entry fee");
    require(fight.participants.length < 20, "Max participants exceeded");

    fight.totalPrizePool += msg.value;

    fight.participants.push(_nftId);

    emit FighterEnteredMatch(_fightId, msg.sender, _nftId);
  }

  // function to start a fight
  function startMatch(uint256 _fightId) public onlyOwner whenNotPaused {
    Fight storage fight = fights[_fightId];
    require(getMatchStatus(_fightId), "Fight not active or already started");
    require(
      fight.participants.length >= fight.minParticipants,
      "Not enough participants"
    );

    fight.started = true;
    emit MatchStarted(_fightId);
  }

  // function to finish a fight
  function endMatch(
    uint256 _fightId,
    uint256[] memory _winningIds
  ) public onlyOwner whenNotPaused {
    Fight storage fight = fights[_fightId];
    require(fight.started, "Fight not started");
    require(
      _winningIds.length == fight.numWinners,
      "Incorrect number of winners"
    );

    fight.active = false;
    fight.started = false;
    fight.ended = true;
    fight.winningFighterIds = _winningIds;

    // pizePool = 80% of total prize pool
    uint256 prizePool = (fight.totalPrizePool * 80) / 100;

    for (uint256 i = 0; i < fight.numWinners; i++) {
      // calculate winner prize
      uint256 winnerPrize = (prizePool * fight.prizeDistribution[i]) / 100;
      address winnerOwner = getOwnerOfAvatar(_winningIds[i]);
      require(winnerOwner != address(0), "Winner not found in fight");

      // transfer winner prize
      payable(winnerOwner).transfer(winnerPrize);
    }

    emit MatchEnded(_fightId, _winningIds);
  }

  // function to get nft token owner
  function getOwnerOfAvatar(
    uint256 _nftId
  ) private view whenNotPaused returns (address) {
    return nftToken.ownerOf(_nftId);
  }

  // function to get winning
  function getRaceResults(
    uint256 _fightId
  ) public view whenNotPaused returns (uint256[] memory) {
    require(fights[_fightId].ended, "Fight has not ended yet");

    return fights[_fightId].winningFighterIds;
  }

  // function to get if the
  function getMatchStatus(
    uint256 _fightId
  ) public view whenNotPaused returns (bool active) {
    require(_fightId < _nextMatchId.current(), "Fight does not exist");

    Fight storage fight = fights[_fightId];
    return fight.active && !fight.started;
  }

  // function to get if the fight was ended
  function isEndedMatch(
    uint256 _fightId
  ) public view whenNotPaused returns (bool active) {
    require(_fightId < _nextMatchId.current(), "Fight does not exist");

    Fight storage fight = fights[_fightId];
    return fight.ended;
  }

  // function to get the totalPrizePool from a fight
  function getTotalPrizePoolRace(
    uint256 _fightId
  ) private view whenNotPaused returns (uint256 totalPrizePool) {
    require(_fightId < _nextMatchId.current(), "Fight does not exist");

    Fight storage fight = fights[_fightId];
    return fight.totalPrizePool;
  }

  function pause() public onlyOwner {
    _pause();
  }

  function unpause() public onlyOwner {
    _unpause();
  }
}

contracts/racing/BettingHub.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "./AvatarSmashEvent.sol";

contract BettingHub is Ownable, Pausable {
  AvatarSmashEvent public smashEvent;

  using Counters for Counters.Counter;
  Counters.Counter private _nextBetId;

  struct Bet {
    uint256 betId;
    uint256 matchId;
    uint256[] fighterIds;
    uint256 betAmount;
    address bettor;
    bool isClaimed;
  }

  mapping(uint256 => mapping(uint256 => Bet)) public betsByFight;

  event BetPlaced(
    uint256 indexed matchId,
    uint256 betId,
    address indexed bettor,
    uint256 betAmount
  );
  event BetClaimed(
    uint256 indexed matchId,
    uint256 betId,
    address indexed bettor,
    uint256 winnings
  );

  constructor(address _nftContractAddress) {
    smashEvent = AvatarSmashEvent(_nftContractAddress);
  }

  // function to place a bet
  function placeBet(
    uint256 _fightId,
    uint256[] memory _nftIds
  ) public payable whenNotPaused {
    require(
      smashEvent.getMatchStatus(_fightId),
      "Race not active or already started"
    );

    uint256 betId = _nextBetId.current();

    // store bet
    betsByFight[_fightId][betId] = Bet({
      betId: betId,
      matchId: _fightId,
      fighterIds: _nftIds,
      betAmount: msg.value,
      bettor: msg.sender,
      isClaimed: false
    });

    _nextBetId.increment();

    emit BetPlaced(_fightId, betId, msg.sender, msg.value);
  }

  // function to claim winnings
  function claimWinnings(
    uint256 _fightId,
    uint256 _betId
  ) public whenNotPaused {
    Bet storage bet = betsByFight[_fightId][_betId];

    require(bet.bettor != address(0), "Bet does not exist");
    require(smashEvent.isEndedMatch(_fightId), "Race is not ended");
    require(bet.bettor == msg.sender, "Not the bettor");
    require(!bet.isClaimed, "Winnings already claimed");

    // get fight results
    uint256[] memory fightResults = smashEvent.getRaceResults(_fightId);

    // Check if the bet is a winning bet
    require(isWinningBet(bet, fightResults), "Bet did not win");

    // calculate winnings
    uint256 winnings = calculateWinnings(bet, _fightId);

    uint256 contractBalance = address(this).balance;
    require(winnings <= contractBalance, "Contract does not have enough funds");

    // set bet as claimed
    bet.isClaimed = true;

    // transfer winnings
    payable(msg.sender).transfer(winnings);

    emit BetClaimed(_fightId, _betId, msg.sender, winnings);
  }

  // check if bet is a winning bet in the correct order
  function isWinningBet(
    Bet memory _bet,
    uint256[] memory _fightResults
  ) private pure returns (bool) {
    if (_bet.fighterIds.length != _fightResults.length) {
      return false;
    }
    for (uint256 i = 0; i < _bet.fighterIds.length; i++) {
      if (_bet.fighterIds[i] != _fightResults[i]) {
        return false;
      }
    }
    return true;
  }

  // function to calculate winnings
  function calculateWinnings(
    Bet memory _bet,
    uint256 _fightId
  ) private view returns (uint256) {
    uint256 winnings = 0;
    // calculate total bet on same selection
    uint256 totalBetOnSameSelection = calculateTotalBetOnSelection(
      _bet.fighterIds,
      _fightId
    );

    // calculate winnings based on popularity
    winnings = calculateWinningsBasedOnPopularity(
      _bet.betAmount,
      totalBetOnSameSelection
    );

    return winnings;
  }

  // function to get total bets on a selection
  function calculateTotalBetOnSelection(
    uint256[] memory _selection,
    uint256 _fightId
  ) private view returns (uint256) {
    uint256 total = 0;
    uint256 betCount = _nextBetId.current();

    for (uint256 i = 0; i < betCount; i++) {
      Bet memory bet = betsByFight[_fightId][i];
      if (areSelectionsEqual(_selection, bet.fighterIds)) {
        total += bet.betAmount;
      }
    }

    return total;
  }

  // function to check if two selections are equal
  function areSelectionsEqual(
    uint256[] memory _selectionA,
    uint256[] memory _selectionB
  ) private pure returns (bool) {
    if (_selectionA.length != _selectionB.length) {
      return false;
    }
    for (uint256 i = 0; i < _selectionA.length; i++) {
      if (_selectionA[i] != _selectionB[i]) {
        return false;
      }
    }
    return true;
  }

  // function to calculate winnings based on popularity
  function calculateWinningsBasedOnPopularity(
    uint256 _betAmount,
    uint256 _totalBetOnSameSelection
  ) private pure returns (uint256) {
    if (_totalBetOnSameSelection > _betAmount) {
      return _betAmount + (_betAmount / 2); // 1.5x original bet
    } else {
      return _betAmount * 2; // duplicate original bet
    }
  }

  function pause() public onlyOwner {
    _pause();
  }

  function unpause() public onlyOwner {
    _unpause();
  }
}

